import React, { Component } from 'react';

const axios = require('axios')

class App extends Component {
    constructor(props){
        super(props);
        this.state = {
            words: [],
            frequencyCount: [],
            sortedFC: []
        }
        this.words = [];
        this.x = ''
    }
    componentDidMount(){
        axios.get('http://localhost:5001/api/api')
            .then((response) => {
                this.setState( state => ({
                    ...state,
                    words: this.state.words.concat(response.data.words),
                    frequencyCount: this.state.frequencyCount.concat(response.data.frequencyCount),
                    sortedFC: this.state.sortedFC.concat(response.data.sortedFC)
                }))
            })
            .catch(function (error) {
                console.log(error);
            });
            this.x = 'yash'
    }

    render() {
        console.log(this.state)
        var i = 0;
        var words = this.state.sortedFC.map( w => {
            i++;
            return <p key={i}>{w[0]+" "+w[1]}</p>
        })
        return (
            <div>
            <main role="main">
                <div className="jumbotron">
